import React from "react";
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import Card from "./Card";
import Wrapper from "../assets/wrappers/Carousel";
import FlashSales from "./FlashSales";


const Carousels = () => {

  var cards = [
    {
      image:
        'https://s3-us-west-2.amazonaws.com/s.cdpn.io/331810/sample87.jpg',
      title: 'Burgundy Flemming',
      subtitle: 'Advertising',
    },
    {
      image:
        'https://s3-us-west-2.amazonaws.com/s.cdpn.io/331810/sample119.jpg',
      title: 'Nigel Nigel',
      subtitle: 'Sound & Vision',
    },
    {
      image:
        'https://s3-us-west-2.amazonaws.com/s.cdpn.io/331810/sample120.jpg',
      title: 'Caspian Bellevedere',
      subtitle: 'Accounting',
    },
  ];

  var image = this.props.data.image,
    title = this.props.data.title,
    subtitle = this.props.data.subtitle;
  var Article = React.createClass({
    render: function () {
      var image = this.props.data.image,
        title = this.props.data.title,
        subtitle = this.props.data.subtitle;
      return (
        <figure className='snip1584'>
          <img src={image} />
          <figcaption>
            <h3>{title}</h3>
            <h5>{subtitle}</h5>
          </figcaption>
          <a href='#'></a>
        </figure>
      );
    },
  });



  

  
  
  
  return (
    <Wrapper>
      <div>
        <h1>Card</h1>
       
        
      </div>
    </Wrapper>
  );
};

export default Carousels;
